Inclusion Criteria:

* Age 18-60;
* Patients planning to undergo video-assisted thoracoscopic (VATS) lung surgery requiring DLT intubation;
* Patients who agreed to participate in this study.

Exclusion Criteria:

* American Society of Anesthesiologists (ASA) classification \> IV;
* Patients with severe nasal obstruction; expected difficult intubation or difficulty with mask ventilation;
* Morbid obesity \[Body Mass Index (BMI)\>35kg/m2)\];
* Airway anatomical abnormalities;
* Abnormal coagulation function;
* Emergency surgery;
* Patients at high risk of reflux aspiration, including ileus, full stomach, esophageal reflux disease;
* Pregnant or breastfeeding women.

Inclusion Criteria:

1. A relative (i.e., sibling, parent, child, grandparent, aunt, uncle, cousin) or spouse of a newly-diagnosed lung or head and neck cancer patient or orthopedic patient (e.g., arthritis, bone and joint infection, foot and ankle conditions, hand, wrist, and elbow conditions such as carpal tunnel syndrome, shoulder and elbow conditions, such as rotator cuff injury, and knee conditions, such as ligament damage repair);
2. A regular smoker (i.e., smoke 10 cigarettes/day on average);
3. Able to use NRT (see contraindications under Key Exclusion Criteria);
4. Age 18 or older (to use NRT); and
5. Living within \~50 miles of PENN (to allow for meetings at PENN).

Exclusion Criteria:

1. Cannot communicate in English;
2. Have current alcohol abuse/dependence;
3. Are or have been diagnosed with cancer, asthma, HIV, emphysema, or COPD;
4. Have a current medical problem for which NRT is contraindicated such as uncontrolled hypertension (\> 150 over 90), unstable angina, heart attack or stroke within the past 6 months, and liver and/or kidney failure in the last 6-months;
5. Currently use monoamine oxidase inhibitors or benzodiazepines, anti-psychotics, and antidepressants, including bupropion;
6. Are allergic to adhesive tape or latex, and
7. Are a female who is pregnant or nursing.

Inclusion Criteria:

1. Patient aged 18-75 years old;
2. 6 mm ≤ tumor size ≤ 20 mm;
3. 0.25 \< CTR \< 1;
4. Center of tumor located in the middle third of the lung field;
5. ECOG score of 0,1 or 2;
6. Lung function (FEV1 ≥ 1 L and ≥ 70%);
7. Both lung segmentectomy and lobectomy could achieve R0 resection;
8. No serious cardiopulmonary complications, and could withstand both lung segmentectomy and lobectomy;
9. No hilus pulmonis and mediastinal lymph node metastasis and no distant metastasis;
10. Single tumor nodule or the concomitant nodule \< microinvasive tumor;
11. Written informed consent.

Exclusion Criteria:

1. The tumor nodule is located in right middle lobe;
2. A history of other malignancies in the last 5 years (exclusion of early-staged thyroid cancer);
3. Have received preoperative anti-tumor therapy, including prior chemotherapy, radiation therapy, target therapy and so on;
4. A serious mental illness;
5. Pregnant and lactating women;
6. Congestive heart failure, myocardial infarction, severe stenosis of coronary artery within recent 6 months;
7. With the history of cerebral infarction or cerebral hemorrhage within 6 months;
8. With the history of sustained systemic corticosteroid therapy within 1 month;
9. The predicted surgical margin is less than 2 cm or the maximum diameter of the tumor at the 3D-CTBA
10. Other unsuitable situations;

Inclusion Criteria:

* Eligible participants were those aged 45-75 years, and with either of the following risk factors:

  1. history of cigarette smoking ≥ 20 pack-years, and, if former smokers, had quit within the previous 15 years;
  2. malignant tumors history in immediate family members;
  3. personal cancer history;
  4. professional exposure to carcinogens;
  5. long term exposure to second-hand smoke;
  6. long term exposure to cooking oil fumes.

Exclusion Criteria:

* Had a CT scan of chest within last 12 months
* History of any cancer within 5 years
